export default (function(a,b,c,d,e){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:b,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:b,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:c,pageSize:25,pageCount:c,total:5}}},skNZNr8EQB:{data:{id:2307,attributes:{imdbId:"tt1104006",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjEyMDQ3NjEzN15BMl5BanBnXkFtZTgwMzA5NTcwMzE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"4.8\u002F10"}],item_lang:{data:{id:2970,attributes:{title:"Walled In",plot:"A young woman who recently graduated from engineering school travels to a remote location to supervise the demolition of a mysterious building. She soon discovers the horrifying secrets of the building and its past inhabitants, many of whom were victims of a vicious murderer who entombed his prey alive within its walls. Now she must turn the tables on the killer before she becomes his latest victim.",slug:"walled-in"}}},books:{data:[{id:11226,attributes:{title:"La moisson d'hiver",description:"Dans les derniers mois de la Seconde Guerre mondiale, Julien, exilé depuis cinq ans au fond d'un pensionnat, apprend que son grand-père est mort dans d'étranges circonstances, lui laissant pour tout héritage les miettes de la propriété familiales, là-bas, en Normandie. Au sein d'une nature âpre, sur un domaine réduit à un champ miné par les Allemands et à une maison de maître qu'une bombe anglaise, non désamorcée rend inhabitable, l'enfant doit réapprendre à vivre avec Claire, sa mère, dont il n'a reçu que de rares lettres lorsqu'il était interne. Très vite le jeune garçon prend conscience qu'un mystère ronge le passé de sa famille. Qui hante les bois aux alentours de la maison ? A qui appartient ce regard que l'enfant sent en permanence posé sur sa nuque ? Véritable thriller paysan, la Moisson d'hiver nous plonge dans un monde d'intrigues où la jalousie obsessionnelle pousse chacun aux pires extrémités et où les secrets de famille prennent la dimension d'une énigme policière. \" Un grand écrivain populaire \" Le Magazine Littéraire \" Un pur bonheur romanesque \" L'Express \" L'une des voix originales du roman français \" Le Monde",thumbnail:d,authors:[e],firstBook:true,published:"1994-01-01",publisher:"Editions Denoël",subtitle:"roman"}},{id:11227,attributes:{title:"The Deep Sea Diver's Syndrome",description:"An undisputed French master of the fantastic—as prolific as Stephen King; as original as Philip K. Dick—now in English for the first time They call them “mediums”—professional dreamers who “dive” into the dream world to retrieve items that convert to valuable artworks in the waking world. What's more, the more dangerous the dream, the more valuable that artwork becomes. In David Sarella’s dreams, he’s a professional jewel thief. With the help of his beautiful accomplice, Nadia, he breaks into jewelry stores and museums, lifts diamond necklaces and priceless art, and escapes into the night on a motorcycle—often, with the police shooting at them. But the pressure is always on David to dream up more audaciously dangerous heists. And meanwhile, the dives are taking their toll, both physically and mentally. David is beyond the point at which this “syndrome” forces most mediums to retire or face insanity or even death . . . and yet he can’t imagine full-time life in the waking world, a world with no Nadia . . . And so he decides to go down one more time—on the deepest dream-dive he’s ever attempted—to settle his doubts and pull off one last spectacular job . . .",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ueqsCAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:null,published:"2016-01-19",publisher:"Melville House",subtitle:d}}]}}},meta:{}}},prerenderedAt:1681703487675}}("movie","series",1,"","Serge Brussolo"))